import React, { useEffect, useState } from "react";

const SinglePlayer = (props) => {
  return (
    <div class="single-player-view">
      <div class="header-info">
        <p class="pup-title">{props.data.name}</p>
        <p class="pup-number">#{props.data.id}</p>
      </div>
      <p>Team: {props.data.team ? props.data.team.name : "Unassigned"}</p>
      <p>Breed: {props.data.breed}</p>
      <img src={props.data.imageUrl} alt="photo of the puppy" />
      <button id="see-all">Back to all players</button>
    </div>
  );
};

export default SinglePlayer;
